////////////////////////////////\r\n\r\n    function _doSafeTransferAcceptanceCheck(address _operator, address _from, address _to, uint256 _id, uint256 _value, bytes memory _data) internal {\r\n\r\n        // If this was a hybrid standards solution you would have to check ERC165(_to).supportsInterface(0x4e2312e0) here but as this is a pure implementation of an ERC-1155 token set as recommended by\r\n        // the standard, it is not necessary. The below should revert in all failure cases i.e. _to isn\'t a receiver, or it is and either returns an unknown value or it reverts in the call to indicate non-acceptance.\r\n\r\n\r\n        // Note: if the below reverts in the onERC1155Received function of the _to address you will have an undefined revert reason returned rather than the one in the require test.\r\n        // If you want predictable revert reasons consider using low level _to.call() style instead so the revert does not bubble up and you can revert yourself on the ERC1155_ACCEPTED test.\r\n        require(ERC1155TokenReceiver(_to).onERC1155Received(_operator, _from, _id, _value, _data) == ERC1155_ACCEPTED, "contract returned an unknown value from onERC1155Received");\r\n    }\r\n\r\n    function _doSafeBatchTransferAcceptanceCheck(address _operator, address _from, address _to, uint256[] memory _ids, uint256[] memory _values, bytes memory _data) internal {\r\n\r\n        // If this was a hybrid standards solution you would have to check ERC165(_to).supportsInterface(0x4e2312e0) here but as this is a pure implementation of an ERC-1155 token set as recommended by\r\n        // the standard, it is not necessary. The below should revert in all failure cases i.e. _to isn\'t a receiver, or it is and either returns an unknown value or it reverts in the call to indicate non-acceptance.\r\n\r\n        // Note: if the below reverts in the onERC1155BatchReceived function of the _to address you will have an undefined revert reason returned rather than the one in the require test.\r\n        // If you want predictable revert reasons consider using low level _to.call() style instead so the revert does not bubble up and you can revert yourself on the ERC1155_BATCH_ACCEPTED test.\r\n        require(ERC1155TokenReceiver(_to).onERC1155BatchReceived(_operator, _from, _ids, _values, _data) == ERC1155_BATCH_ACCEPTED, "contract returned an unknown value from onERC1155BatchReceived");\r\n    }\r\n}\r\n',sourcePath:"C:\\Users\\paulg\\Documents\\polats\\arcade\\contracts\\ERC1155.sol",ast:{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/ERC1155.sol",exportedSymbols:{ERC1155:[493]},id:494,nodeType:"SourceUnit",nodes:[{id:29,literals:["solidity","^","0.5",".0"],nodeType:"PragmaDirective",src:"0:23:2"},{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/SafeMath.sol",file:"./SafeMath.sol",id:30,nodeType:"ImportDirective",scope:494,sourceUnit:2953,src:"27:24:2",symbolAliases:[],unitAlias:""},{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/Address.sol",file:"./Address.sol",id:31,nodeType:"ImportDirective",scope:494,sourceUnit:19,src:"53:23:2",symbolAliases:[],unitAlias:""},{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/Common.sol",file:"./Common.sol",id:32,nodeType:"ImportDirective",scope:494,sourceUnit:28,src:"78:22:2",symbolAliases:[],unitAlias:""},{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/IERC1155TokenReceiver.sol",file:"./IERC1155TokenReceiver.sol",id:33,nodeType:"ImportDirective",scope:494,sourceUnit:2099,src:"102:37:2",symbolAliases:[],unitAlias:""},{absolutePath:"/C/Users/paulg/Documents/polats/arcade/contracts/IERC1155.sol",file:"./IERC1155.sol",id:34,nodeType:"ImportDirective",scope:494,sourceUnit:2054,src:"141:24:2",symbolAliases:[],unitAlias:""},{baseContracts:[{arguments:null,baseName:{contractScope:null,id:35,name:"IERC1155",nodeType:"UserDefinedTypeName",referencedDeclaration:2053,src:"243:8:2",typeDescriptions:{typeIdentifier:"t_contract$_IERC1155_$2053",t